import TableCard from "src/views/table/TableCard";

const Completed =()=>{
    const columns = [
        {
          dataField: "#taskId",
          text: "#taskId",

        },
        {
          dataField: "title",
          text: "Title",

          sort: true
        },
        {
          dataField: "writerName",
          text: "Writer Username",

        },
        {
          dataField: "email",
          text: "email",

        },
        {

            dataField: "status",
            text: "status",


        },
        {

            dataField: "category",
            text: "Category",


        },
        {

          dataField: "sdate",
          text: "Submited-Date",


      },
      {

        dataField: "ddate",
        text: "Deadline",


      },
        {
            dataField: "Action",
            text: "Action",

          }
      ];
      const products=[
        {
          "#taskId":"686787678",
          title:"iuytfrdfgh",
          writerName:"wilson",
          email:"wilson@gmail.com",
          status:"in-progress",
          category:"Lorem",
          sdate:'2011-9-10',
          ddate:"2011-8-8",
          Action:<button  className="btn btn-info">Details</button>
        }
      ]
    return <>
             <TableCard 
             products={products}
             columns={columns}
              title={"COMPLETED ORDERS"}
             />
          </>

}

export default Completed;
